class StatsBase {
  /// 球员基础信息
  Player playerBaseInfo;

  /// 同位置球员
  List<Player> playerPos;

  /// 联盟球员赛季数据
  LeagueSeasonStat playerLeagueSeasonStat;

  /// 联盟球队赛季数据
  LeagueSeasonStat teamLeagueSeasonStat;

  /// 球员赛季数据
  SeasonDataStat playerSeasonStat;

  /// 球队赛季数据
  SeasonDataStat teamSeasonStat;

  /// 球员本赛季每场比赛数据（包括季前赛、常规赛、季后赛）
  List<PlayerMatch> playerMatch;

  /// 球员生涯数据（包括季前赛、常规赛、季后赛）
  List<SeasonDataStat> playerCareer;

  static StatsBase fromMap(Map<String, dynamic> map) {
    if (map == null) return null;
    StatsBase bean = StatsBase();
    bean.playerBaseInfo = map['playerBaseInfo'] == null
        ? null
        : Player.fromMap(map['playerBaseInfo']);
    bean.playerPos = List()
      ..addAll((map['playerPos'] as List ?? []).map((o) => Player.fromMap(o)));
    bean.playerLeagueSeasonStat = map['playerLeagueSeasonStat'] == null
        ? null
        : LeagueSeasonStat.fromMap(map['playerLeagueSeasonStat']);
    bean.playerSeasonStat = map['playerSeasonStat'] == null
        ? null
        : SeasonDataStat.fromMap(map['playerSeasonStat']);
    bean.teamLeagueSeasonStat = map['teamLeagueSeasonStat'] == null
        ? null
        : LeagueSeasonStat.fromMap(map['teamLeagueSeasonStat']);
    bean.teamSeasonStat = map['teamSeasonStat'] == null
        ? null
        : SeasonDataStat.fromMap(map['teamSeasonStat']);
    bean.playerMatch = List()
      ..addAll((map['playerMatch'] as List ?? [])
          .map((o) => PlayerMatch.fromMap(o)));
    bean.playerCareer = List()
      ..addAll((map['playerCareer'] as List ?? [])
          .map((o) => SeasonDataStat.fromMap(o)));
    return bean;
  }

  Map toJson() => {
        "playerBaseInfo": playerBaseInfo,
        "nbaPlayerPos": playerPos,
        "nbaPlayerLeagueSeasonStat": playerLeagueSeasonStat,
        "nbaPlayerSeasonStat": playerSeasonStat,
        "playerMatch": playerMatch,
        "playerCareer": playerCareer,
      };
}

