/// title : "东部联盟"
/// type : 1

class RankBase {
  List<Rank> list;
  String title;
  int type;

  static RankBase fromMap(Map<String, dynamic> map) {
    if (map == null) return null;
    RankBase testBean = RankBase();
    testBean.list = List()
      ..addAll((map['list'] as List ?? []).map((o) => Rank.fromMap(o)));
    testBean.title = map['title'];
    testBean.type = map['type'];
    return testBean;
  }

  Map toJson() => {
        "list": list,
        "title": title,
        "type": type,
      };
}

