/// matchType : "2"

class MatchBaseBean {
  ScheduleList teamInfo;
  PeriodGoalsBean periodGoals;
  List<MaxPlayersBean> maxPlayers;
  List<TeamStatsBean> teamStats;
  PlayerStatsBean playerStats;
  String matchType;

  static MatchBaseBean fromMap(Map<String, dynamic> map) {
    if (map == null) return null;
    MatchBaseBean bean = MatchBaseBean();
    bean.teamInfo = ScheduleList.fromMap(map['teamInfo']);
    bean.periodGoals = PeriodGoalsBean.fromMap(map['periodGoals']);
    bean.maxPlayers = List()
      ..addAll((map['maxPlayers'] as List ?? [])
          .map((o) => MaxPlayersBean.fromMap(o)));
    bean.teamStats = List()
      ..addAll((map['teamStats'] as List ?? [])
          .map((o) => TeamStatsBean.fromMap(o)));
    bean.playerStats = PlayerStatsBean.fromMap(map['playerStats']);
    bean.matchType = map['matchType'];
    return bean;
  }

  Map toJson() => {
        "teamInfo": teamInfo,
        "periodGoals": periodGoals,
        "maxPlayers": maxPlayers,
        "teamStats": teamStats,
        "playerStats": playerStats,
        "matchType": matchType,
      };
}

