    if (map == null) return null;
    PlayerMatchStats bean = PlayerMatchStats();
    bean.row = List()
      ..addAll((map['row'] as List ?? []).map((o) => o.toString()));
    bean.playerId = map['playerId'];
    bean.ifHasUrl = map['ifHasUrl'];
    bean.enName = map['enName'];
    bean.pic = map['pic'];
    bean.onCrt = map['onCrt'];
