    return bean;
  }

  Map toJson() => {
        "row": row,
        "playerId": playerId,
        "ifHasUrl": ifHasUrl,
        "enName": enName,
        "pic": pic,
        "onCrt": onCrt,
        "pos": pos,
      };
}

